INSERT INTO endings(id, nombre, descripcion, anime, num, created, updated) VALUES('1', 'Dare ka, Umi', 'Yuuki Ozaki. El tema de cierre es Dare ka, Umi o (誰か、海を。 lit. Alguien, el océano?) compuesto por Yōko Kanno e interpretada por Aimer.', '1', '1', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO endings(id, nombre, descripcion, anime, num, created, updated) VALUES('2', 'Yume Sekai', 'Yume Sekai (ユメセカイ Yume Sekai) es el primer ending del anime de Sword Art Online. Es interpretado por la cantante japonesa Haruka Tomatsu, quien también es la actriz de voz de Asuna. ', '2', '1', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
