INSERT INTO openings(id, nombre, descripcion, anime, num, created, updated) VALUES('1', 'Trigger', 'La banda sonora fue compuesta por Yōko Kanno. El tema de apertura es Trigger, compuesto por Kanno e interpretada por el vocalista de Galileo Galilei,', '1', '1', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO openings(id, nombre, descripcion, anime, num, created, updated) VALUES('2', 'Crossing Field', 'Crossing Field es el primer opening del anime de Sword Art Online. Es interpretado por la cantante japonesa LiSA, con la composición de Watanabe Sho. ', '2', '1', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO openings(id, nombre, descripcion, anime, num, created, updated) VALUES('3', 'Innocence', 'INNOCENCE es el segundo opening del anime de Sword Art Online. Es interpretado por Aoi Eir con la composición de Ryosuke Shigenaga. Este opening abarca el arco de ALO (desde el episodio 15 hasta el episodio 24), remplazando a Crossing Field. Esta can', '2', '2', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO openings(id, nombre, descripcion, anime, num, created, updated) VALUES('4', 'Ignite', 'IGNITE es el tercer opening del anime y el primero de la segunda temporada. Esta canción también fue utilizada como el ending del episodio 26, utiliza la misma animación del opening, pero con los créditos del ending, de manera similar a cómo se utili', '3', '1', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO openings(id, nombre, descripcion, anime, num, created, updated) VALUES('5', 'Courage', 'courage es el cuarto opening del anime y el segundo de la segunda temporada (Usado desde el Episodio 40 hasta el Episodio 49, Abarcando el Arco Calibur y el Arco Mother`s Rosario). Es interpretado por Haruka Tomatsu.', '3', '2', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO openings(id, nombre, descripcion, anime, num, created, updated) VALUES('6', 'Courage', 'courage es el cuarto opening del anime y el segundo de la segunda temporada (Usado desde el Episodio 40 hasta el Episodio 49, Abarcando el Arco Calibur y el Arco Mother`s Rosario). Es interpretado por Haruka Tomatsu.', '3', '2', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO openings(id, nombre, descripcion, anime, num, created, updated) VALUES('7', 'Re:Re:', 'El opening es Re:Re: interpretado por el grupo Asian Kung-Fu Generation de su álbum Sol-Fa.', '4', '1', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO openings(id, nombre, descripcion, anime, num, created, updated) VALUES('8', 'Jonetsu de Mune ATSU!', 'Es interpretado por T-Pistonz, en colaboración con KMC. Este Opening sale en los episodios Impares (1,3,5,7,...) hasta el episodio 17 donde junto con su contraparte en números pares Kando Kyoyu! son reemplazados por Shoshin wo KEEP ON! a partir del E', '5', '1', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO openings(id, nombre, descripcion, anime, num, created, updated) VALUES('9', 'Kando Kyoyu!', 'Kando Kyoyu! (感動共有!,, trad. Comparte la emoción! en japonés) es la canción usada para el segundo opening del anime de Inazuma Eleven GO Chrono Stones y el sexto del anime de Inazuma Eleven GO en general.', '5', '2', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO openings(id, nombre, descripcion, anime, num, created, updated) VALUES('10', 'Shoshin wo KEEP ON!', 'Shoshin wo KEEP ON! (初心を KEEP ON, trad. Continúa con tu propósito inicial en japonés) es la canción usada para el tercer opening del anime de Inazuma Eleven GO Chrono Stones y el septimo del anime de Inazuma Eleven GO en general. ', '5', '3', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO openings(id, nombre, descripcion, anime, num, created, updated) VALUES('11', 'Raimei! Blue Train!', 'Raimei! Blue Train! (ライメイ！ブルートレイン, trad. Trueno! Tren azul! en japonés, Tren de la Luz, Luz Exprés en español) es la canción usada para el cuarto y último opening del anime de Inazuma Eleven GO Chrono Stones, el octavo del anime de Inazuma Eleven GO ', '5', '4', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
