INSERT INTO personages(id, nombre, descripcion, fecha_nacimiento, fecha_muerte, anime, created, updated) values('1',  'Nine', 'Nine (ナイン Nain) Es el protagonista de Zankyou No Terror junto con Twelve, a quien trata como hermano. ', '', '', '1', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO personages(id, nombre, descripcion, fecha_nacimiento, fecha_muerte, anime, created, updated) values('2',  'Twelve', 'Twelve (ツエルブ Tsuerubu) Es uno de los protagonistas de Zankyou No Terror, Siendo parte del  dúo de terrorista que tiene en jaque a la policía de Tokyo. Ve a Nine como un hermano y viven juntos. Ambos se hacen llamar así mismo Sphinx antes sus vídeos q', '', '', '1', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO personages(id, nombre, descripcion, fecha_nacimiento, fecha_muerte, anime, created, updated) values('3',  'Lisa Mishima', 'Lisa asiste a la misma escuela secundaria que Nine y Twelve. Ella es víctima de bullying, y tiene problemas con su madre. Después de conocer a Twelve, su destino cambia drásticamente', '', '', '1', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO personages(id, nombre, descripcion, fecha_nacimiento, fecha_muerte, anime, created, updated) values('4',  'Kenjirō Shibazaki', 'Kenjirō Shibazaki (柴崎 健次郎 Shibazaki Kenjirō) Es un miembro de la Policía Metropolitana de Tokyo que solia ser parte de la fuerza de Policía en el departamento de  investigaciones. ', '', '', '1', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO personages(id, nombre, descripcion, fecha_nacimiento, fecha_muerte, anime, created, updated) values('5',  'Five', 'Five (ハイヴ, haivu) es un agente del gobierno y una científica nuclear afiliada con NEST, una organización dentro de los Estados Unidos (FBI). Ella viaja a Japón para ayudar en las investigaciones sobre los ataques terroristas. ', '', '', '1', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO personages(id, nombre, descripcion, fecha_nacimiento, fecha_muerte, anime, created, updated) values('6',  'kirito', 'Kazuto Kirigaya (ヶ谷和人, Kirigaya Kazuto), también conocido como Kirito (キリト Kirito), cuyo apodo es una contracción de su nombre escrito según la onomástica japonesa es decir Kirigaya Kazuto, es el protagonista de la franquicia Sword Art Online y un áv', '', '', '2', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO personages(id, nombre, descripcion, fecha_nacimiento, fecha_muerte, anime, created, updated) values('7',  'Asuna', 'Asuna Yukki (アスナ, Asuna) es uno de los personajes principales de la serie. Ella fue uno de los 10.000 jugadores atrapados en el juego de la muerte Sword Art Online. En el mundo real, su nombre es Asuna Yuuki (結城明日奈 Yūki Asuna), siendo el único usuari', '', '', '2', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO personages(id, nombre, descripcion, fecha_nacimiento, fecha_muerte, anime, created, updated) values('8',  'Leafa', 'Es la hermanastra/prima de Kazuto, a pesar de ser primos ella siente una fuerte atracción hacia él. Se especializa en kendo en la vida real siguiendo los deseos de su abuelo. ', '', '', '2', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO personages(id, nombre, descripcion, fecha_nacimiento, fecha_muerte, anime, created, updated) values('9',  'Oberon', 'Es un investigador de la empresa desarrolladora de tecnologia RCT. El utiliza los recursos de la compañia para realizar experimentos ilicitos con jugador y asi alcanzar sus egoistas propositos. ', '', '', '2', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO personages(id, nombre, descripcion, fecha_nacimiento, fecha_muerte, anime, created, updated) values('10',  'Heathcliff', 'Akihiko Kayaba (茅場晶彦 Kayaba Akihiko) es el creador de Sword Art Online, el primer VRMMORPG y el diseñador del NerveGear, el Sistema Cardinal y La semilla. Él fue participe de su propia creación como Game Master y como el líder de los Caballeros de la', '', '', '2', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO personages(id, nombre, descripcion, fecha_nacimiento, fecha_muerte, anime, created, updated) values('11',  'Kirito', 'Kazuto Kirigaya conocido como Kirito entra en el juego GGO a investigar sobre las misteriosas muertes y a su lado Shino Asada le ayuda como su guía.', '', '', '3', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO personages(id, nombre, descripcion, fecha_nacimiento, fecha_muerte, anime, created, updated) values('12',  'Sinon', 'Shino Asada Es una hábil jugadora de Gun Gale Online con las armas de alto alcance pese a que en el mundo real siente cierto temor por las armas de fuego. ', '', '', '3', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO personages(id, nombre, descripcion, fecha_nacimiento, fecha_muerte, anime, created, updated) values('13',  'Asuna', ' Asuna Yuuki Es una Undine conocida en ALO como Sanadora impetuosa debido al hecho de que le gusta pelear ocasionalmente en la línea delantera con su estoque pese a su papel de sanadora.', '', '', '3', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO personages(id, nombre, descripcion, fecha_nacimiento, fecha_muerte, anime, created, updated) values('14',  'Yuuki', 'Es una espadachina de ALO con una increíble velocidad y una poderosa técnica. Es la líder de un peculiar gremio llamado Caballeros Durmientes. ', '', '', '3', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO personages(id, nombre, descripcion, fecha_nacimiento, fecha_muerte, anime, created, updated) values('15',  'Death Gun', 'Es un misterioso jugador que aparecio en Gun Gale Online haciendose temer por su extraña habilidad de conectar la muerte de un jugador en el mundo virtual con la muerte en el mundo real. ', '', '', '3', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
