CREATE DATABASE cosasdeanime
  WITH ENCODING='UTF8'
       TEMPLATE=postgres
       LC_COLLATE='es_ES.UTF-8'
       LC_CTYPE='es_ES.UTF-8'
       CONNECTION LIMIT=-1
       TABLESPACE=pg_default;

CREATE USER cosasdeanime WITH ENCRYPTED PASSWORD 'cosasdeanime';
GRANT ALL PRIVILEGES ON DATABASE cosasdeanime TO cosasdeanime;

