CREATE TABLE comment (
 id SERIAL NOT NULL PRIMARY KEY,
 comment VARCHAR(250) NOT NULL,
 fecha VARCHAR(200) NOT NULL,
 hora VARCHAR(55) NULL,
 "user" VARCHAR(55) DEFAULT NULL,
 episode int4 NOT NULL,
 anime int4 NOT NULL,
 manga int4 NOT NULL,
 created timestamp DEFAULT CURRENT_TIMESTAMP,
 updated timestamp DEFAULT CURRENT_TIMESTAMP
);

CREATE TABLE media ( 
id SERIAL NOT NULL PRIMARY KEY,
type VARCHAR(255) NOT NULL,
 name VARCHAR(255),
 extension VARCHAR(255) NOT NULL,
 orden int4,
 main int4 DEFAULT NULL,
 anime int4 DEFAULT NULL,
 opening int4 DEFAULT NULL,
 ending int4 DEFAULT NULL,
 episode int4 DEFAULT NULL,
 manga int4 DEFAULT NULL,
 personage int4 DEFAULT NULL,
 "user" VARCHAR(55) DEFAULT NULL,
 created timestamp DEFAULT CURRENT_TIMESTAMP,
 updated timestamp DEFAULT CURRENT_TIMESTAMP
);

CREATE TABLE metadata (
id SERIAL NOT NULL PRIMARY KEY,
 visiteds int4,
 created timestamp DEFAULT CURRENT_TIMESTAMP,
 updated timestamp DEFAULT CURRENT_TIMESTAMP
);

CREATE TABLE atributtes (
id SERIAL NOT NULL PRIMARY KEY,
  "user" VARCHAR(55) NULL,
  anime int4 DEFAULT NULL,
  opening int4 DEFAULT NULL,
  ending int4 DEFAULT NULL,
  episode int4 DEFAULT NULL,
  manga int4 DEFAULT NULL,
  personage int4 DEFAULT NULL,
  favorite bool DEFAULT false,
  collection int4 DEFAULT NULL
);

CREATE TABLE users (
  "user" VARCHAR(55) PRIMARY KEY NOT NULL,
   nombre VARCHAR(255) NULL,
  apellidos VARCHAR(255) NULL,
  email VARCHAR(255) NULL,
  password VARCHAR(255) NULL,
  date_birthday VARCHAR(255) NULL,
  tipo VARCHAR(50) NULL,
  avatar VARCHAR(255) NULL,
  dni VARCHAR(255) NULL,
  token VARCHAR(255) NULL,
  activado bool NULL,
  genere VARCHAR(25) NULL,
  created timestamp DEFAULT CURRENT_TIMESTAMP,
  updated timestamp DEFAULT CURRENT_TIMESTAMP
);

CREATE TABLE collections (
id SERIAL NOT NULL PRIMARY KEY,
  name VARCHAR(255) NOT NULL,
  "user" VARCHAR(55) DEFAULT NULL,
  created timestamp DEFAULT CURRENT_TIMESTAMP,
  updated timestamp DEFAULT CURRENT_TIMESTAMP
);

CREATE TABLE reserve (
id SERIAL NOT NULL PRIMARY KEY,
  name VARCHAR(255) NOT NULL,
  timestart time NULL,
  timeend time NULL,
  datestart date NULL,
  dateend date NULL,
  "user" VARCHAR(55) NULL,
  created timestamp DEFAULT CURRENT_TIMESTAMP,
  updated timestamp DEFAULT CURRENT_TIMESTAMP
);

CREATE TABLE animes (
id SERIAL NOT NULL PRIMARY KEY,
   siglas VARCHAR(250) NOT NULL,
  titulo_es VARCHAR(250) DEFAULT NULL,
  titulo_en VARCHAR(250) DEFAULT NULL,
  titulo_va VARCHAR(250) DEFAULT NULL,
  titulo_ca VARCHAR(250) DEFAULT NULL,
  sinopsis_es VARCHAR(255) DEFAULT NULL,
  sinopsis_en VARCHAR(255) DEFAULT NULL,
  sinopsis_va VARCHAR(255) DEFAULT NULL,
  sinopsis_ca VARCHAR(255) DEFAULT NULL,
  generes text DEFAULT NULL,
  idiomas text DEFAULT NULL,
  date_publication VARCHAR(250) DEFAULT NULL,
  date_finalization VARCHAR(250) DEFAULT NULL,
  state VARCHAR(250) DEFAULT NULL,
  kind VARCHAR(25) DEFAULT NULL,
  valorations int4 DEFAULT NULL,
  created timestamp DEFAULT CURRENT_TIMESTAMP,
  updated timestamp DEFAULT CURRENT_TIMESTAMP,
  views int4 DEFAULT 0,
  downloads int4 DEFAULT 0,
  temporada VARCHAR(25) DEFAULT NULL
);

CREATE TABLE episodes (
  id SERIAL NOT NULL PRIMARY KEY,
  titulo_es VARCHAR(250) DEFAULT NULL,
  titulo_en VARCHAR(250) DEFAULT NULL,
  titulo_va VARCHAR(250) DEFAULT NULL,
  titulo_ca VARCHAR(250) DEFAULT NULL,
  idiomas text NOT NULL,
  anime int4 NOT NULL,
  views int4 DEFAULT 0,
  downloads int4 DEFAULT 0,
  created timestamp DEFAULT CURRENT_TIMESTAMP,
  updated timestamp DEFAULT CURRENT_TIMESTAMP,
  num int4 DEFAULT 1
);

CREATE TABLE openings (
id SERIAL NOT NULL PRIMARY KEY,
  nombre VARCHAR(150),
  descripcion VARCHAR(255) NOT NULL,
  anime int4 NOT NULL,
  created timestamp DEFAULT CURRENT_TIMESTAMP,
  updated timestamp DEFAULT CURRENT_TIMESTAMP,
  num int4 DEFAULT 1
);

CREATE TABLE endings (
id SERIAL NOT NULL PRIMARY KEY,
  nombre VARCHAR(150),
  descripcion VARCHAR(255) NOT NULL,
  anime int4 NOT NULL,
  created timestamp DEFAULT CURRENT_TIMESTAMP,
  updated timestamp DEFAULT CURRENT_TIMESTAMP,
  num int4 DEFAULT 1
);

CREATE TABLE personages (
id SERIAL NOT NULL PRIMARY KEY,
  nombre VARCHAR(150) NOT NULL,
  descripcion VARCHAR(255) NOT NULL,
  fecha_nacimiento VARCHAR(150) NOT NULL,
  fecha_muerte VARCHAR(150) NOT NULL,
  anime int4 NOT NULL,
  created timestamp DEFAULT CURRENT_TIMESTAMP,
  updated timestamp DEFAULT CURRENT_TIMESTAMP
);

CREATE TABLE chat(
id SERIAL NOT NULL PRIMARY KEY,
 "message" VARCHAR(255) NOT NULL, 
   emiitter VARCHAR(50) NOT NULL, 
  receptor VARCHAR(50) NOT NULL, 
  date VARCHAR(200) NOT NULL, 
  hour VARCHAR(55) NOT NULL
);

CREATE TABLE config (
id SERIAL NOT NULL PRIMARY KEY,
  "user" VARCHAR(55) DEFAULT NULL,
  theme bool DEFAULT false,
  autoplay bool DEFAULT false,
  columns int4 NOT NULL,
  orden VARCHAR(150) NOT NULL,
  ordenepi VARCHAR(150) NOT NULL,
  lang text NOT NULL,
  vol int4 NOT NULL,
  default_view VARCHAR(150) NOT NULL,
  avable_chat bool DEFAULT false,
  avable_history bool DEFAULT false,
  limit_elem_collection int4 NOT NULL,
  created timestamp DEFAULT CURRENT_TIMESTAMP,
  updated timestamp DEFAULT CURRENT_TIMESTAMP
);

CREATE TABLE history(
id SERIAL NOT NULL PRIMARY KEY,
  episode_id int4 NOT NULL,
  "user" VARCHAR(55) DEFAULT NULL,
  created timestamp DEFAULT CURRENT_TIMESTAMP,
  time VARCHAR(25) NOT NULL,
  updated timestamp DEFAULT CURRENT_TIMESTAMP
);

CREATE TABLE searches (
    id SERIAL NOT NULL PRIMARY KEY,
 search text NOT NULL,
 kind text NOT NULL,
 "user" VARCHAR(55) DEFAULT NULL,
 anime int4 NOT NULL,
 created timestamp DEFAULT CURRENT_TIMESTAMP,
 updated timestamp DEFAULT CURRENT_TIMESTAMP
);

